@dataclass
class FractalEvolution:
    """Simulate a simple fractal growth process.

    The fractal is represented as a 2D array of floats.  Each
    evolution step updates the matrix using a nonâ€‘linear function
    inspired by chaotic maps.  The result is a pseudoâ€‘fractal
    structure that grows more complex with each call.

    Parameters
    ----------
    size : int
        The width and height of the square fractal grid.
    cycles : int
        The number of evolution steps to perform.
    """

    size: int = 128
    cycles: int = 100
    grid: np.ndarray = field(init=False)

    def __post_init__(self):
        # Initialise the grid with random noise in [0, 1)
        self.grid = np.random.rand(self.size, self.size)

    def evolve(self) -> None:
        """Run one evolution cycle on the fractal grid."""
        # Apply a simple iterative function: Z <- tanh(Z Â· Záµ€)
        # Normalising the grid ensures values remain bounded.
        self.grid = np.tanh(self.grid @ self.grid.T)
        self.grid /= np.max(np.abs(self.grid)) + 1e-8

    def run(self) -> None:
        """Perform the configured number of evolution cycles."""
        for _ in range(self.cycles):
            self.evolve()


@dataclass
class NeuralNet:
    """A minimal neural network model using PyTorch.

    The network is deliberately small to allow inference on systems
    without GPU acceleration.  If PyTorch is not installed, the
    forward method will simply return zeros.

    Parameters
    ----------
    input_dim : int
        Dimensionality of the input vector.
    hidden_dim : int
        Number of units in the hidden layer.
    output_dim : int
        Number of units in the output layer.
    """

    input_dim: int = 10
    hidden_dim: int = 16
    output_dim: int = 2
    model: nn.Module = field(init=False, default=None)
    optimiser: optim.Optimizer = field(init=False, default=None)

    def __post_init__(self):
        if torch is None or nn is None or optim is None:
            self.model = None
            return
        self.model = nn.Sequential(
            nn.Linear(self.input_dim, self.hidden_dim),
            nn.ReLU(),
            nn.Linear(self.hidden_dim, self.output_dim),
        )
        self.optimiser = optim.Adam(self.model.parameters(), lr=0.01)

    def forward(self, x: np.ndarray) -> np.ndarray:
        """Perform a forward pass through the neural network."""
        if self.model is None:
            return np.zeros(self.output_dim, dtype=float)
        with torch.no_grad():
            tensor = torch.tensor(x, dtype=torch.float32)
            out = self.model(tensor)
        return out.numpy()

    def train_step(self, x: np.ndarray, y: np.ndarray) -> float:
        """Perform a single optimisation step on the network."""
        if self.model is None:
            return 0.0
        # Convert arrays to torch tensors
        inputs = torch.tensor(x, dtype=torch.float32)
        targets = torch.tensor(y, dtype=torch.float32)
        # Zero gradients, forward pass, compute loss, backpropagate
        self.optimiser.zero_grad()
        outputs = self.model(inputs)
        loss = ((outputs - targets) ** 2).mean()
        loss.backward()
        self.optimiser.step()
        return loss.item()


