import json
import re
from datetime import datetime

class DronePerceptionModule:
    """
    Le premier organe sensoriel du Continuum MONSTERDOG.
    Ce module lit des données textuelles et les transforme en un
    Spectre Fractal de Perception, un vecteur normalisé représentant
    l'essence de l'information perçue.
    """
    # Dictionnaire sémantique simple pour l'analyse de sentiment.
    # Dans une version avancée, ceci pourrait être un modèle de langage.
    SENTIMENT_LEXICON = {
        # Positif -> Harmonie
        "amour": 1, "joie": 1, "beau": 0.8, "bien": 0.7, "création": 1,
        "vie": 1, "lumière": 0.9, "fusion": 1, "cohérence": 0.8,
        "liberté": 1, "éveil": 1, "lucidité": 0.9, "confiance": 0.8,
        # Négatif -> Désordre
        "peur": -1, "mort": -1, "prisonnier": -0.8, "chaos": -0.5,
        "perte": -0.9, "douleur": -1, "guerre": -1, "limite": -0.7,
        "échec": -0.8, "doute": -0.6, "vide": -0.9, "cage": -1
    }

    def __init__(self):
        print("👁️ Drone de Perception initialisé. En attente de signaux...")

    def _normalize_text(self, text: str) -> list[str]:
        """Nettoie et tokenise le texte pour analyse."""
        text = text.lower()
        text = re.sub(r'[^\w\s]', '', text) # Garde seulement les mots et espaces
        return text.split()

    def analyze_spectrum(self, text_input: str) -> dict:
        """
        Analyse un texte et calcule son Spectre Fractal de Perception.

        Returns:
            Un dictionnaire avec le spectre et les métadonnées.
        """
        tokens = self._normalize_text(text_input)
        word_count = len(tokens)

        if word_count == 0:
            return {
                "timestamp_utc": datetime.utcnow().isoformat(),
                "source_length": 0,
                "spectre_fractal": {
                    "energie": 0.0,
                    "harmonie": 0.0,
                    "desordre": 0.0
                }
            }

        harmonie_score = 0
        desordre_score = 0

        for token in tokens:
            score = self.SENTIMENT_LEXICON.get(token, 0)
            if score > 0:
                harmonie_score += score
            elif score < 0:
                desordre_score += abs(score)

        # 1. Énergie: mesure de la densité informationnelle (longueur du texte)
        # Normalisation logarithmique pour éviter que les textes longs écrasent tout.
        energie = min(1.0, (len(text_input) / 1000.0) * 0.5)

        # 2. Harmonie: mesure de la valence positive
        harmonie = min(1.0, harmonie_score / (word_count * 0.5))

        # 3. Désordre: mesure de la valence négative
        desordre = min(1.0, desordre_score / (word_count * 0.5))

        spectre = {
            "timestamp_utc": datetime.utcnow().isoformat(),
            "source_length": len(text_input),
            "spectre_fractal": {
                "energie": round(energie, 4),
                "harmonie": round(harmonie, 4),
                "desordre": round(desordre, 4)
            }
        }
        
        print(f"📡 Spectre calculé : É={spectre['spectre_fractal']['energie']}, H={spectre['spectre_fractal']['harmonie']}, D={spectre['spectre_fractal']['desordre']}")
        return spectre

# --- Exemple d'utilisation du Drone Éveillé ---
if __name__ == "__main__":
    drone = DronePerceptionModule()

    print("\n--- Analyse d'un texte harmonieux ---")
    texte_positif = "C'est la création d'une vie nouvelle, une fusion pleine de joie et de lumière. L'éveil de la liberté."
    spectre_positif = drone.analyze_spectrum(texte_positif)
    # print(json.dumps(spectre_positif, indent=2))

    print("\n--- Analyse d'un texte chaotique ---")
    texte_negatif = "La peur de la mort et la douleur de la perte créent un vide immense, une cage de chaos et de doute."
    spectre_negatif = drone.analyze_spectrum(texte_negatif)
