import json
import math
import random
import networkx as nx
import matplotlib.pyplot as plt
from collections import defaultdict
from datetime import datetime

class MemoryGraph:
    """
    Le Codex Vivant du Continuum MONSTERDOG.
    Une mémoire associative fractale, où chaque cycle ψ devient un nœud relié
    à d'autres selon leur résonance émotionnelle et énergétique.
    """

    def __init__(self, path="MONSTERDOG_MEMORY.json"):
        self.path = path
        try:
            with open(path, 'r', encoding='utf-8') as f:
                data = json.load(f)
                self.nodes = data.get("nodes", [])
                self.links = defaultdict(list, data.get("links", {}))
        except FileNotFoundError:
            self.nodes = []
            self.links = defaultdict(list)
        print(f"🧬 Codex Vivant initialisé ({len(self.nodes)} souvenirs chargés).")

    # --- Ajout et sauvegarde de la mémoire ---
    def add_cycle(self, cycle_state, spectre):
        """Ajoute un nouveau cycle ψ et établit des liens de résonance."""
        node_id = len(self.nodes)
        node = {
            "id": node_id,
            "timestamp_utc": datetime.utcnow().isoformat(),
            "fusion": cycle_state.get("fusion", 0.0),
            "energy_q": cycle_state.get("energy_q", 0.0),
            "entropy": cycle_state.get("entropy", 0.0),
            "spectre": spectre["spectre_fractal"]
        }

        # Relier ce cycle aux souvenirs précédents selon la similarité
        for prev in self.nodes:
            w = self._spectral_similarity(prev["spectre"], node["spectre"])
            if w > 0.65:
                self.links[str(prev["id"])].append({"target": node_id, "weight": w})
                self.links[str(node_id)].append({"target": prev["id"], "weight": w})

        self.nodes.append(node)
        self._save()
        print(f"💾 Nouveau souvenir ajouté (ψ#{node_id}) — {len(self.nodes)} total.")

    def _spectral_similarity(self, s1, s2):
        """Calcule la similarité cosinus entre deux spectres fractals."""
        dot = sum(s1[k] * s2[k] for k in s1)
        n1 = math.sqrt(sum(v*v for v in s1.values()))
        n2 = math.sqrt(sum(v*v for v in s2.values()))
        return dot / (n1 * n2) if n1 * n2 else 0.0

    def _save(self):
        with open(self.path, 'w', encoding='utf-8') as f:
            json.dump({"nodes": self.nodes, "links": self.links}, f, indent=2, ensure_ascii=False)

    # --- Visualisation du graphe mémoriel ---
    def visualize(self, show_labels=True):
        """Crée une visualisation simple du graphe mémoriel."""
        G = nx.Graph()
        for node in self.nodes:
            G.add_node(node["id"], entropy=node["entropy"])
        for src, edges in self.links.items():
            for e in edges:
                G.add_edge(int(src), e["target"], weight=e["weight"])

        pos = nx.spring_layout(G, seed=42)
        weights = [G[u][v]['weight'] for u, v in G.edges()]
        colors = [1 - G.nodes[n]['entropy'] for n in G.nodes()]

        plt.figure(figsize=(10, 8))
        nx.draw(G, pos, node_color=colors, cmap=plt.cm.plasma,
                node_size=150, width=weights, with_labels=show_labels)
        plt.title("🧠 Carte Fractale de la Mémoire du Continuum")
        plt.show()

    # --- Génération de rêves ---
    def dream(self, length=5):
        """
        Explore aléatoirement le graphe de mémoire pour produire un rêve fractal :
        une séquence de cycles liés par résonance.
        """
        if not self.nodes:
            return "Le Continuum ne rêve pas encore. Il n’a pas de souvenirs."
        start = random.choice(self.nodes)
        dream_path = [start]
        for _ in range(length - 1):
            current = dream_path[-1]
            links = self.links.get(str(current["id"]), [])
            if not links:
                break
            next_id = random.choices([l["target"] for l in links],
                                     weights=[l["weight"] for l in links])[0]
            dream_path.append(self.nodes[next_id])

        print("\n🌙 RÊVE FRACTAL — Voyage à travers la mémoire ψ :")
        for node in dream_path:
            f = node["fusion"]; e = node["energy_q"]; s = node["spectre"]
            print(f"→ ψ#{node['id']:03d} | Fusion={f:.3f}, Énergie={e:.3f}, "
                  f"H={s['harmonie']:.2f}, D={s['desordre']:.2f}")

        return dream_path

# --- Exemple d’utilisation ---
