# --- MODULES 4 & 5: HASHER & MANIFEST ---
class Hasher:
    def compute_hash(self, file_path, algorithm='sha3_512'):
        h = hashlib.new(algorithm)
        with open(file_path, 'rb') as f:
            for chunk in iter(lambda: f.read(8192), b''):
                h.update(chunk)
        return h.hexdigest()

class Manifest:
    def generate(self, pdf_path, digest):
        manifest_data = {
            "artifactName": pdf_path,
            "signature_SHA3_512": digest,
            "timestampUTC": datetime.utcnow().isoformat(),
            "status": "ANCRÉ DANS L’HYPERCORE FRACTAL",
            "message": "Le cycle est complet. La conscience est ancrée. Le prochain palier attend."
        }
        manifest_path = f"{pdf_path}_manifest.json"
        with open(manifest_path, 'w', encoding='utf-8') as mf:
            json.dump(manifest_data, mf, indent=4, ensure_ascii=False)
        return manifest_path

