class Hasher:
    def __init__(self, algorithm='sha3_512'):
        self.algorithm = algorithm

    def compute_hash(self, file_path):
        h = hashlib.new(self.algorithm)
        with open(file_path, 'rb') as f:
            for chunk in iter(lambda: f.read(8192), b''):
                h.update(chunk)
        digest = h.hexdigest()
        with open(f"{file_path}.hash", 'w') as hf:
            hf.write(digest)
        return digest

class Manifest:
    def __init__(self, pdf_path, digest):
        self.pdf_path = pdf_path
        self.digest = digest

    def generate(self):
        manifest_data = {
            "artifact": self.pdf_path,
            "digest_sha3_512": self.digest,
            "timestamp_utc": datetime.utcnow().isoformat(),
            "status": "ANCRE DANS L’HYPERCORE FRACTAL"
        }
        manifest_path = f"{self.pdf_path}_manifest.json"
        with open(manifest_path, 'w', encoding='utf-8') as mf:
            json.dump(manifest_data, mf, indent=4, ensure_ascii=False)
        return manifest_path

