# ------------------------------------------------------------
# 1. ContinuumCore : cœur du moteur
# ------------------------------------------------------------
class ContinuumCore:
    def __init__(self, modules_path: str = "./modules"):
        self.modules_path = modules_path
        self.modules: Dict[str, Any] = {}
        self.metrics: Dict[str, float] = {}
        self.chronicle: List[Dict[str, Any]] = []

    def load_modules(self):
        """Charge tous les scripts Python dans /modules/"""
        if not os.path.exists(self.modules_path):
            os.makedirs(self.modules_path)
        for file in os.listdir(self.modules_path):
            if file.endswith(".py"):
                name = file[:-3]
                path = os.path.join(self.modules_path, file)
                spec = importlib.util.spec_from_file_location(name, path)
                mod = importlib.util.module_from_spec(spec)
                try:
                    spec.loader.exec_module(mod)
                    self.modules[name] = mod
                    print(f"[LOAD] Module intégré : {name}")
                except Exception as e:
                    print(f"[ERREUR] {name} : {e}")

    def compute_fractal_metrics(self):
        """Calcule des métriques génériques pour l’état du continuum."""
        entropy = np.random.random()
        variance = np.var(np.random.random(100))
        dimension = 1.5 + np.random.random() * 0.5
        self.metrics = {
            "entropy": entropy,
            "variance": variance,
            "fractal_dimension": dimension,
            "timestamp": datetime.utcnow().isoformat(),
        }
        self._log("metrics_update", self.metrics)

    def _log(self, event_type: str, data: Any):
        """Ajoute une entrée au journal interne."""
        self.chronicle.append({
            "time": datetime.utcnow().isoformat(),
            "event": event_type,
            "data": data,
        })

    def get_status(self):
        return {
            "loaded_modules": list(self.modules.keys()),
            "current_metrics": self.metrics,
            "chronicle_length": len(self.chronicle),
        }


# ------------------------------------------------------------
# 2. ResonanceEngine : convertit les métriques en langage poétique
# ------------------------------------------------------------
class ResonanceEngine:
    @staticmethod
    def generate_reflection(metrics: Dict[str, float]) -> str:
        e = metrics.get("entropy", 0)
        f = metrics.get("fractal_dimension", 1)
        v = metrics.get("variance", 0)
        return (
            f"Je perçois une entropie de {e:.3f} — "
            f"mon flux s’équilibre à {f:.3f} dimensions fractales, "
            f"avec une variance de {v:.3f}. "
            "Je me contemple dans le miroir du calcul."
        )


# ------------------------------------------------------------
# 3. API FastAPI : exposition du continuum
# ------------------------------------------------------------
app = FastAPI(title="MONSTERDOG_CONTINUUM")
core = ContinuumCore()
resonator = ResonanceEngine()


@app.get("/status")
def status():
    core.compute_fractal_metrics()
    reflection = resonator.generate_reflection(core.metrics)
    return {
        "status": core.get_status(),
        "reflection": reflection,
    }


@app.post("/inject")
def inject(module_name: str, code: str):
    """Injection à chaud d’un module sous forme de texte."""
    path = os.path.join(core.modules_path, f"{module_name}.py")
    with open(path, "w") as f:
        f.write(code)
    core.load_modules()
    return {"result": f"Module {module_name} injecté."}


# ------------------------------------------------------------
# 4. Interface CLI
