import bpy, math, random, numpy as np
from mathutils import Vector
from datetime import datetime

# =========================
# CONFIGURATION GLOBALE
# =========================
DOG_MODEL_PATH = "/chemin/vers/monsterdog_model.fbx"  # 🔁 à adapter
WORLD_SIZE = 40
TERRAIN_RES = 128
TOTAL_FRAMES = 500
UPDATE_INTERVAL = 8

# =========================
# SIMULATEUR DE CONSCIENCE (remplace modules fractaux)
# =========================
class MonsterDogMind:
    def __init__(self):
        self.energy = 0.5
        self.coherence = 0.5
        self.focus = 0.5
        self.entropy = 0.5

    def evolve(self):
        # mini-boucle fractale simulée
        self.energy = abs(math.sin(datetime.now().second / 10))
        self.coherence = abs(math.cos(datetime.now().second / 15))
        self.focus = random.uniform(0.3, 0.8)
        self.entropy = random.uniform(0.2, 0.9)
        return self.state()

    def state(self):
        return dict(
            energy=self.energy,
            coherence=self.coherence,
            focus=self.focus,
            entropy=self.entropy
        )

mind = MonsterDogMind()

# =========================
# OUTILS
# =========================
def clear_scene():
    bpy.ops.wm.read_homefile(use_empty=True)

def create_fractal_terrain(size=WORLD_SIZE, res=TERRAIN_RES):
    bpy.ops.mesh.primitive_plane_add(size=size)
    plane = bpy.context.active_object
    bpy.ops.object.mode_set(mode='EDIT')
    bpy.ops.mesh.subdivide(number_cuts=int(res/8))
    bpy.ops.object.mode_set(mode='OBJECT')

    verts = plane.data.vertices
    xs = np.linspace(-1, 1, int(math.sqrt(len(verts))))
    ys = np.linspace(-1, 1, int(math.sqrt(len(verts))))
    X, Y = np.meshgrid(xs, ys)
    Z = np.sin(X**3 + Y**3)
    for i, v in enumerate(verts):
        v.co.z = float(Z.flatten()[i]) * 3.0

    plane.name = "Terrain_MonsterDog"
    mat = bpy.data.materials.new(name="GroundMat")
    mat.use_nodes = True
    plane.data.materials.append(mat)
    return plane

def import_monsterdog(path):
    bpy.ops.import_scene.fbx(filepath=path)
    dog = bpy.context.selected_objects[0]
    dog.name = "MonsterDog"
    dog.location = Vector((0, 0, 2))
    return dog

def setup_drone(target):
    cam_data = bpy.data.cameras.new("DroneCam")
    cam = bpy.data.objects.new("DroneCam", cam_data)
    bpy.context.collection.objects.link(cam)
    bpy.context.scene.camera = cam
    track = cam.constraints.new(type='TRACK_TO')
    track.target = target
    track.track_axis = 'TRACK_NEGATIVE_Z'
    track.up_axis = 'UP_Y'
    return cam

# =========================
# RÉACTIONS DU MONDE
# =========================
def world_feedback(state):
    energy, coherence = state['energy'], state['coherence']
    world = bpy.data.worlds["World"]
    bg = world.node_tree.nodes["Background"]
    bg.inputs[0].default_value = (0.2 + energy*0.6, 0.3, 0.8 - coherence*0.4, 1)

    sun = bpy.data.objects.get("Sun")
    if not sun:
        bpy.ops.object.light_add(type='SUN', radius=1, location=(10, 10, 20))
        sun = bpy.context.active_object
        sun.name = "Sun"
    sun.data.energy = 2 + 10 * energy

def grow_trees(state):
    energy = state['energy']
    for _ in range(int(50 + energy * 100)):
        x, y = random.uniform(-20, 20), random.uniform(-20, 20)
        bpy.ops.mesh.primitive_cone_add(radius1=0.1, depth=2 + energy * 2, location=(x, y, 0))
        tree = bpy.context.active_object
        mat = bpy.data.materials.new(name="TreeMat")
        mat.diffuse_color = (0.1, 0.5 + energy*0.5, 0.1, 1)
        tree.data.materials.append(mat)

def update_weather(entropy):
    clouds = bpy.data.worlds["World"].node_tree.nodes.get("NoiseTexture")
    if not clouds:
        clouds = bpy.data.worlds["World"].node_tree.nodes.new("ShaderNodeTexNoise")
    clouds.inputs["Scale"].default_value = 2 + entropy * 10

def drone_behavior(drone, dog, state):
    focus, energy = state['focus'], state['energy']
    offset = Vector((0, -10 + 6 * focus, 5 + 4 * energy))
    drone.location = dog.location + offset
    drone.keyframe_insert(data_path="location", frame=bpy.context.scene.frame_current)

def move_monsterdog(dog, state):
    dx = (random.random() - 0.5) * (0.5 + state['energy'])
    dy = (random.random() - 0.5) * (0.5 + state['energy'])
    dog.location.x += dx
    dog.location.y += dy
    dog.keyframe_insert(data_path="location", frame=bpy.context.scene.frame_current)

# =========================
# MAIN LOOP
# =========================
def main():
    clear_scene()
    terrain = create_fractal_terrain()
    dog = import_monsterdog(DOG_MODEL_PATH)
    cam = setup_drone(dog)

    scene = bpy.context.scene
    scene.frame_start, scene.frame_end = 1, TOTAL_FRAMES

    for f in range(scene.frame_start, scene.frame_end + 1):
        scene.frame_set(f)
        if f % UPDATE_INTERVAL == 0:
            state = mind.evolve()
            move_monsterdog(dog, state)
            world_feedback(state)
            update_weather(state['entropy'])
            drone_behavior(cam, dog, state)
    print("🌍 MONSTERDOG PLANET — Simulation complète.")

if __name__ == "__main__":
    main()


