# Mines repeating n-grams from byte streams to hypothesize a "grammar" of the anomaly.

import json, collections, itertools, sys

def mine_ngrams(b: bytes, n: int = 3, topk: int = 16):
    counts = collections.Counter(b[i:i+n] for i in range(max(0, len(b)-n+1)))
    top = counts.most_common(topk)
    # normalize to hex strings for readability
    return [{"ngram_hex": t[0].hex(), "count": t[1]} for t in top]

def infer_grammar(chunks, n_values=(2,3,4), topk=16):
    # chunks: iterable of bytes
    out = {"grams": []}
    for n in n_values:
        merged = b"".join(chunks)
        out["grams"].append({"n": n, "top": mine_ngrams(merged, n=n, topk=topk)})
    return out

def main():
    # Read stdin as hex or raw; for demo we use a synthetic stream
    demo = bytes(range(256)) * 4
    grammar = infer_grammar([demo], n_values=(2,3,4), topk=16)
    print(json.dumps(grammar, indent=2))

if __name__ == "__main__":
    main()
