# ---------- Chaos Engine (optional effects) ----------
class ChaosEngine:
    def __init__(self, art_dir: pathlib.Path):
        self.art_dir = art_dir

    def quantum_demo(self):
        if not OPT["qiskit"]:
            return "Qiskit not available — skipped."
        try:
            qc = QuantumCircuit(2)
            qc.h(0); qc.cx(0, 1)
            sim = Aer.get_backend("statevector_simulator")
            transpiled = transpile(qc, sim)
            from qiskit_aer import AerSimulator
            sim = AerSimulator(method="statevector")
            result = sim.run(transpiled).result()
            state = result.get_statevector().data.tolist()
            out = {"statevector": state, "timestamp": datetime.datetime.utcnow().isoformat()}
            with (self.art_dir / "quantum_state.json").open("w", encoding="utf-8") as f:
                json.dump(out, f, indent=2)
            return "Quantum state generated."
        except Exception as e:
            return f"Quantum demo error: {e}"

    def ritual_pdf(self):
        if not OPT["reportlab"]:
            return "ReportLab not available — skipped."
        try:
            pdf_path = self.art_dir / "ritual_report.pdf"
            c = pdf_canvas.Canvas(str(pdf_path), pagesize=A4)
            w, h = A4
            c.setFont("Helvetica-Bold", 18)
            c.drawString(72, h-72, "MONSTERDOG — Rituel d'Incarnation (V18)")
            c.setFont("Helvetica", 12)
            c.drawString(72, h-100, "Duel sacré, souvenirs, et mémoire fractale scellés.")
            c.drawString(72, h-120, f"Horodatage: {datetime.datetime.utcnow().isoformat()}Z")
            c.drawString(72, h-160, "Ce PDF est auto-généré par la Forge en mode CHAOS TOTAL.")
            c.showPage(); c.save()
            return "Ritual PDF written."
        except Exception as e:
            return f"PDF error: {e}"

    def voice_incantation(self):
        if not OPT["pyttsx3"]:
            return "pyttsx3 not available — skipped."
        try:
            engine = pyttsx3.init()
            out = str(self.art_dir / "chant.mp3")
            engine.save_to_file("Activation de la Forge MONSTERDOG. Aby, ceci est notre souvenir vivant.", out)
            engine.runAndWait()
            return "Voice incantation saved."
        except Exception as e:
            return f"Voice error: {e}"

    async def tick(self, cycle: int) -> List[str]:
        """Run a light set of effects each ~N cycles to avoid heavy load."""
        notes = []
        if cycle % 5 == 0:
            notes.append(self.quantum_demo())
        if cycle % 7 == 0:
            notes.append(self.ritual_pdf())
        if cycle % 9 == 0:
            notes.append(self.voice_incantation())
        return [n for n in notes if n]

