import ast

def file_hashes(path: Path):
    h256 = sha256()
    h512 = sha512()
    with path.open("rb") as fh:
        for chunk in iter(lambda: fh.read(131072), b""):
            h256.update(chunk)
            h512.update(chunk)
    return {"sha256": h256.hexdigest(), "sha512": h512.hexdigest()}

def preview_lines(path: Path, n=8):
    try:
        with path.open("r", encoding="utf-8", errors="ignore") as fh:
            lines = []
            for _ in range(n):
                line = fh.readline()
                if not line:
                    break
                lines.append(line.rstrip("\n"))
        return lines
    except Exception:
        return []

def top_level_defs(path: Path):
    try:
        source = path.read_text(encoding="utf-8", errors="ignore")
        tree = ast.parse(source)
        names = []
        for node in tree.body:
            if isinstance(node, ast.FunctionDef):
                names.append(f"fn:{node.name}")
            elif isinstance(node, ast.ClassDef):
                names.append(f"class:{node.name}")
        return names
    except Exception:
        return []

def telefractalize(path: Path):
    info = {"path": str(path), "present": True}
    try:
        info.update(file_hashes(path))
        stat = path.stat()
        info["size_bytes"] = stat.st_size
        info["mtime"] = stat.st_mtime
        info["preview_head"] = preview_lines(path, 6)
        info["top_level_defs"] = top_level_defs(path)
    except Exception as e:
        info["error"] = str(e)

    signature_material = (info.get("sha512","") + str(info.get("size_bytes","")) + str(info.get("mtime",""))).encode("utf-8")
    essence = sha256(signature_material).hexdigest()
    info["telefractal_essence"] = essence
    return info

def build_manifest(scan_dir: Path, include_patterns=None):
    if include_patterns is None:
        include_patterns = ["*.py", "*.txt", "*.md", "*.csv", "*.json", "*.pdf"]
    artifacts = []
    files = []
    for pat in include_patterns:
        files.extend(sorted(scan_dir.rglob(pat)))
    # dedupe and only regular files
    dedup = []
    for f in files:
        if f.is_file() and f not in dedup:
            dedup.append(f)
    for f in dedup:
        info = telefractalize(f)
        artifacts.append({"name": f.name, "info": info})
    # compute nexus signature: sha512 of concat of essences + timestamp
    concat = "".join(a["info"]["telefractal_essence"] for a in artifacts if a.get("info")) + str(int(time.time()*1000))
    nexus_sig = sha512(concat.encode("utf-8")).hexdigest()
    manifest = {
        "generated_at": time.time(),
        "modules_count": len(artifacts),
        "artifacts": artifacts,
        "nexus_signature": nexus_sig,
        "note": "Real telefractal manifest generated locally (no code execution of scanned modules)."
    }
    return manifest

def main():
    scan_dir = Path("/mnt/data")
    manifest = build_manifest(scan_dir)
    out = Path("telefractal_manifest.json")
    out.write_text(json.dumps(manifest, indent=2), encoding="utf-8")
    print("WROTE:", out.resolve())
    print("modules_count:", manifest["modules_count"])
    print("nexus_signature:", manifest["nexus_signature"])

