class Robot:
    def __init__(self, options=None):
        self.helper = Helper()
        self.running = False
        self.bluetooth_server = None
        self.wifi_server = None

        if options:
            self.load_options(options)

    def load_options(self, options):
        for name, device in options.get("devices", {}).items():
            self.helper.add_device(name, device)

        for name, conn in options.get("connections", {}).items():
            self.helper.add_connection(name, conn)

    def start(self):
        self.running = True
        threading.Thread(target=self.listen_bluetooth, daemon=True).start()
        threading.Thread(target=self.listen_wifi, daemon=True).start()

    def stop(self):
        self.running = False
        if self.bluetooth_server:
            self.bluetooth_server.close()
        if self.wifi_server:
            self.wifi_server.close()

    def listen_bluetooth(self):
        self.bluetooth_server = bluetooth.BluetoothSocket(bluetooth.RFCOMM)
        self.bluetooth_server.bind(("", 1))
