import numpy as np
import pandas as pd
from PIL import Image

# RÃ©duction de la taille des images pour Ã©viter surcharge mÃ©moire
IMAGE_SIZE = (64, 64)

# Dossier des GIFs Ã  analyser (modifie selon ton environnement)
DATA_FOLDER = "chemin/vers/tes/GIFs/"
OUTPUT_CSV = "flux_dynamique_analysis.csv"

# RÃ©cupÃ©rer tous les fichiers GIF
gif_files = [f for f in os.listdir(DATA_FOLDER) if f.endswith(".gif")]

# Liste des donnÃ©es pour stockage allÃ©gÃ©
flux_analysis_data = []

# Analyse frame par frame des variations de mouvement et de lumiÃ¨re
for gif_name in gif_files:
    gif_path = os.path.join(DATA_FOLDER, gif_name)
    try:
        with Image.open(gif_path) as img:
            img.seek(0)  # PremiÃ¨re frame
            prev_frame = np.array(img.convert("L").resize(IMAGE_SIZE))

            for i in range(1, img.n_frames):
                img.seek(i)
                current_frame = np.array(img.convert("L").resize(IMAGE_SIZE))

                # Calcul de la diffÃ©rence dâ€™intensitÃ© entre les frames
                delta_intensity = np.mean(np.abs(current_frame - prev_frame))

                # Enregistrement des variations
                flux_analysis_data.append({
                    "gif_name": gif_name,
                    "frame_index": i,
                    "delta_intensity": delta_intensity
                })

                prev_frame = current_frame

    except Exception as e:
        print(f"Erreur lors de l'analyse du GIF {gif_name}: {e}")

# Sauvegarde des mÃ©triques dans un fichier CSV
df = pd.DataFrame(flux_analysis_data)
df.to_csv(OUTPUT_CSV, index=False)

print(f"ðŸ“Š Analyse des flux dynamiques terminÃ©e. RÃ©sultats enregistrÃ©s dans {OUTPUT_CSV}.") 
