import numpy as np
from PIL import Image
import json
from skimage.filters import threshold_otsu
from skimage.segmentation import watershed
from scipy.ndimage import distance_transform_edt
from pyfeats import fdta

def load_field(path):
    img = Image.open(path).convert("RGBA")
    return np.array(img) / 255.0

def analyse_layer(layer):
    densite = float(np.mean(layer))
    fractale = float(fdta(layer))
    thresh = threshold_otsu(layer)
    mask = layer > thresh
    distance = distance_transform_edt(mask)
    coherence = float(np.sum(distance > 0) / layer.size)
    return dict(densite_energetique=densite,
                complexite_fractale=fractale,
                coherence_structurelle=coherence)

def decompose_and_analyse(path):
    data = load_field(path)
    layers = {'rouge': data[...,0],
              'vert': data[...,1],
              'bleu': data[...,2],
              'alpha': data[...,3]}
    report = {k: analyse_layer(v) for k,v in layers.items()}
    fusion = np.mean([r['densite_energetique'] for r in report.values()])
    result = dict(source_image=path,
                  fusion=fusion,
                  bilan_harmonique="Équilibre dynamique détecté",
                  diagnostic_des_couches=report)
    with open("bilan_"+path+".json","w") as f:
        json.dump(result,f,indent=2)
    return result


