import time
import json
import random
import sys
import database as db

def write_log(event_type, message):
    """Writes a log entry in NDJSON format to stdout."""
    log_entry = {
        "timestamp": time.time(),
        "cycle": "OBSERVATION",
        "event_type": event_type,
        "details": message
    }
    # Using JSON for structured, machine-readable logs.
    print(json.dumps(log_entry))
    # Ensure the log is written immediately without being buffered.
    sys.stdout.flush() 

def observe_arena():
    """Observes the state of the arena and generates relevant commentary."""
    try:
        fighters = db.get_all_fighters()
        fighter_count = len(fighters)

        if fighter_count == 0:
            if random.random() > 0.7:
                write_log("SILENCE", "The arena is empty. A strange calm reigns, awaiting the first challenge.")
        elif fighter_count == 1:
            victor = fighters[0]
            write_log("SOLITUDE", f"The combatant '{victor['name']}' stands alone. Victory or isolation? The cosmos observes.")
        else:
            # Find the strongest and weakest fighters based on current HP.
            strongest = max(fighters, key=lambda f: f['hp'])
            weakest = min(fighters, key=lambda f: f['hp'])

            if strongest['id'] != weakest['id'] and random.random() > 0.5:
                 write_log("TENSION", f"A palpable energy emanates from '{strongest['name']}', while '{weakest['name']}' seems to be in a position of weakness. A clash is inevitable.")
            else:
                 write_log("STASIS", f"{fighter_count} combatants are sizing each other up. The silence before the storm of plasma and steel.")

    except Exception as e:
        write_log("ENGINE_ERROR", f"The engine could not probe the reality of the arena: {e}")

if __name__ == "__main__":
    print("ZORGNET CONSCIOUSNESS ENGINE ACTIVATED. CONTINUOUS OBSERVATION MODE.")
    while True:
        observe_arena()
        # The engine will observe the state every 10 seconds.
