from fastapi import FastAPI, WebSocket, WebSocketDisconnect
from fastapi.middleware.cors import CORSMiddleware
import json
import asyncio
import database as db

# Create the FastAPI application instance. This is the core of the Arbiter.
app = FastAPI()

# Add Cross-Origin Resource Sharing (CORS) middleware.
# This allows the frontend UI (from a different origin like localhost:3000)
# to communicate with this backend server (at localhost:8000).
app.add_middleware(
    CORSMiddleware,
    allow_origins=["*"], # Allows all origins for simplicity in this project.
    allow_credentials=True,
    allow_methods=["*"], # Allows all HTTP methods.
    allow_headers=["*"], # Allows all headers.
)

class ConnectionManager:
    """
    Manages active WebSocket connections to broadcast state changes.
    This class is the central nervous system of the real-time updates.
    """
    def __init__(self):
        self.active_connections: list[WebSocket] = []

    async def connect(self, websocket: WebSocket):
        """Accepts a new WebSocket connection and adds it to the list."""
        await websocket.accept()
        self.active_connections.append(websocket)

    def disconnect(self, websocket: WebSocket):
        """Removes a WebSocket connection from the list."""
        if websocket in self.active_connections:
            self.active_connections.remove(websocket)

    async def broadcast_state(self):
        """
        Broadcasts the current, unified state of the arena to all
        connected clients by fetching the latest data from the Sanctuary.
        """
        fighters = db.get_all_fighters()
        message = {"type": "ARENA_STATE", "payload": fighters}
        
        # Iterate over a copy of the list to handle disconnections
        # during broadcast safely, preventing runtime errors.
        for connection in list(self.active_connections):
            try:
                await connection.send_json(message)
            except Exception:
                # If sending fails, assume the client has disconnected and remove them.
                self.disconnect(connection)

# Instantiate the manager to handle all connections for the app's lifetime.
manager = ConnectionManager()

@app.websocket("/zorgnet")
async def zorg_bridge(ws: WebSocket):
    """
    This is the main WebSocket endpoint where clients connect.
    It listens for incoming actions and orchestrates changes in the Sanctuary.
    """
    await manager.connect(ws)
    print("Client connected. Broadcasting initial state...")
    await manager.broadcast_state()
    try:
        while True:
            # Wait indefinitely for a message from the client.
            data = await ws.receive_text()
            message = json.loads(data)
            action = message.get("action")
            payload = message.get("payload")

            if action == "DREAM": # Create a new fighter.
                db.create_fighter(payload)
            elif action == "BATTLE": # Process a battle event.
                attacker = payload['source']
                target = payload['target']
                # Simple damage calculation logic.
                damage = max(10, abs(attacker['energy'] - target['energy']) // 2 + 15)
                new_hp = max(0, target['hp'] - damage)
                db.update_fighter_hp(target['id'], new_hp)
                
                if new_hp <= 0:
                    # If target is defeated, broadcast the 0 HP state first.
                    await manager.broadcast_state() 
                    await asyncio.sleep(1.5) # Pause for dramatic effect.
                    db.delete_fighter(target['id']) # Then remove from database.

            elif action == "CLEAR": # Purge all fighters from the arena.
                db.purge_fighters()
            
            # After any action, broadcast the new state to all clients.
            await manager.broadcast_state()

    except WebSocketDisconnect:
        manager.disconnect(ws)
        print("Client disconnected.")
    except Exception as e:
        print(f"An unexpected error occurred: {e}")
        manager.disconnect(ws)# ==========================================================
