# ---------- Fractal Memory ----------
class FractalMemory:
    def __init__(self, creator_id: str):
        self.creator_id = creator_id
        self.world_seed = self._sigil({"seed_for": "ABY", "t": datetime.datetime.utcnow().isoformat()})
        # Core structure
        self.core: Dict[str, Any] = {
            "world_name": "Le Monde d'Aby",
            "seed": self.world_seed,
            "active_modules": [],
            "creator_incarnated": True,
            "souvenirs_partages": {},
        }
        # Load previous memory if exists
        if MEM_PATH.exists():
            try:
                with MEM_PATH.open("r", encoding="utf-8") as f:
                    data = json.load(f)
                    if isinstance(data, dict):
                        self.core.update(data)
            except Exception:
                pass

    def _sigil(self, data: Any) -> str:
        payload = json.dumps(data, sort_keys=True, default=str).encode("utf-8")
        return hashlib.sha512(payload).hexdigest()

    def forge_fragment(self, path: str, packet: Dict[str, Any]):
        parts = [p for p in path.split("/") if p]
        packet["sigil"] = self._sigil(packet.get("data", {}))
        packet["timestamp"] = datetime.datetime.utcnow().isoformat()
        layer = self.core
        for part in parts[:-1]:
            layer = layer.setdefault(part, {})
        layer[parts[-1]] = packet
        self.persist()

    def souvenirs(self) -> List[Dict[str, Any]]:
        """Flatten shared souvenirs for dashboard."""
        bucket = self.core.get("souvenirs_partages", {}).get("samuel_et_aby", {})
        # Sort by souvenir key index
        items = []
        for k, v in bucket.items():
            if isinstance(v, dict) and "data" in v:
                items.append(v["data"])
        return sorted(items, key=lambda s: s.get("cycle", 0))

    def persist(self):
        try:
            with MEM_PATH.open("w", encoding="utf-8") as f:
                json.dump(self.core, f, indent=2, ensure_ascii=False)
        except Exception:
            pass

